import React from "react";
import '../navbar/navbar.css'

class Navbar extends React.Component {
    render() {
        return (
            <div>
                <nav>
                    <button id="register">Register</button>
                    <button id="login">Login</button>
                </nav>
            </div>
        )
    }
}

export default Navbar
